import styled from "styled-components";

export const ValorEstimado = styled.h1`
    color: ${props => props.theme.loteria};
    font-size: 30px;
    font-weight: bold;
    padding: 20px;
    margin-left: 30px;
`

export const Div = styled.div`
    vertical-align: left;
    width: 400px;
`

export const Texto = styled.div`
    padding: 20px;
    margin-left: 30px;
    max-width: 70%;
`
